import Modal from "../UI/Modal";

const Cart = props =>{
    const cartItems= <ul>{[{id:'c1', name:'Sushi', amoount:2,price:12.99},].map((item)=><li>{item.name}</li>)}</ul>;
    return <Modal>
         {cartItems}
         <div>
            <span>Total Amount</span>
            <span>35.62</span>
         </div>
         <div className="justify-right">
            <button className="gap-4 inline-flex items-center bg-[#F8DE22] border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">Close</button>
            <button className="gap-4 inline-flex items-center bg-[#F8DE22] border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">Order</button>
         </div>
    </Modal>
};
export default Cart;
